export const bubble = require('../icons/bubble.png');
export const clothesW = require("../icons/clothes washing.png");
export const clothes = require("../icons/clothes.png");
export const customer = require("../icons/customer.png");
export const foam = require("../icons/foam bubbles.png");
export const maps = require("../icons/maps.png");
export const messages = require("../icons/message.png");
export const phone = require("../icons/phone.png");
export const warmw = require("../icons/warm washing.png");
export const wmachine = require("../icons/wmachine.png");


export default {
    bubble,
    clothesW,
    clothes,
    customer,
    foam,
    maps,
    messages,
    phone,
    warmw,
    wmachine,
}
